import React, { Component } from 'react';
import Head from '../components/head';
import Layout from '../components/Layout';
import mtuList from '../components/tables/mtuList';
import FormPage from '../components/form';
import news from '../components/tables/newsList';
import OtherNews from '../components/news/OtherNews';

class PageDocuments extends Component {
  render() {
    let content = '';

    content = mtuList.map((item, index) => (
      <details className="product-category" key={`part-${index}`}>
        <summary className="product-category-title">{item.label}</summary>
        {item.files.map((file, index) => (
          <a
            key={`sub-${index}`}
            className="file-link"
            href={`/docs/page-documents${file.path}`}
            target="_blank"
            rel="noopener"
          >
            <img
              className="file-img"
              src="/images/icons/pdf.png"
              title="Скачать PDF"
              alt="PDF"
            />
            <span className="file-title">{file.label}</span>
          </a>
        ))}
      </details>
    ));

    return (
      <div>
        <Head
          title="Документация для проектирования ГПУ"
          description="Документация"
        />
        <Layout>
          <section className="container-fluid documents-promo">
            <div className="container">
              <div className="row">
                <div className="col-12 col-lg-8 col-xl-6">
                  <div className="documents-promo-container">
                    <div className="top">
                      <h1 className="header-min-colored">Проектирование ГПУ</h1>
                      <p className="promo-text">
                        В разделе собрана техническая документация по
                        газопоршневым установкам
                      </p>
                    </div>
                    <div className="bottom">
                      <div className="promo-link">
                        <a
                          className="file-promo-link"
                          href="/docs/page-documents/rukovodstvo-po-proectirovaniu-i-montazu.pdf"
                          target="_blank"
                          rel="noopener"
                        >
                          <img
                            src="/images/icons/pdf.png"
                            title="Скачать PDF"
                            alt="PDF"
                          />
                          <span className="file-title">
                            Руководство по проектированию и монтажу
                          </span>
                          <span className="file-size">(4&nbsp;Мб)</span>
                        </a>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </section>
          <section className="container-fluid documents-content">
            <div className="container">
              <div className="row">
                <div className="col-12">
                  <div className="documents-content-wrapper">{content}</div>
                </div>
              </div>
            </div>
          </section>
          <FormPage />
          <section className="container-fluid news-anons">
            <div className="container">
              {/* <div className="row">
            <div className="col"> */}
              <OtherNews news={news} />
              {/* </div>
          </div> */}
            </div>
          </section>
        </Layout>
        <style jsx>{`
          .documents-promo {
            background: linear-gradient(to right, #e1e1e1 0%, #b1b1b1 100%);
            padding-top: 30px;
            padding-bottom: 30px;
          }
          .documents-promo .documents-promo-container .top .header-min-colored {
            font-size: 24px;
            line-height: 32px;
            color: white;
            letter-spacing: 0.2px;
            text-shadow: 3px 3px 3px rgba(0, 0, 0, 0.3);
          }
          .documents-promo .documents-promo-container .top .text {
            line-height: 18px;
          }
          .documents-promo .documents-promo-container .bottom {
            margin-top: 45px;
          }
          .documents-promo
            .documents-promo-container
            .bottom
            .promo-link
            .file-promo-link {
            display: flex;
            align-items: center;
          }
          .documents-promo
            .documents-promo-container
            .bottom
            .promo-link
            .file-promo-link
            img {
            display: block;
            margin-right: 15px;
          }
          .documents-promo
            .documents-promo-container
            .bottom
            .promo-link
            .file-promo-link
            .file-title {
            display: block;
            line-height: 15px;
            color: var(--text);
          }
          .documents-promo
            .documents-promo-container
            .bottom
            .promo-link
            .file-promo-link
            .file-size {
            display: block;
            color: var(--accent-grey);
          }
          .documents-content {
            padding-top: 30px;
            padding-bottom: 15px;
          }
          .documents-content .documents-content-wrapper .product-category {
            border-radius: 3px;
            box-shadow: var(--box-shadow);
            display: flex;
            flex-direction: column;
            padding: 7px;
            padding-left: 10px;
            background-color: white;
            margin-top: 8px;
            margin-bottom: 8px;
          }
          .documents-content
            .documents-content-wrapper
            .product-category
            .product-category-title {
            color: var(--accent-grey);
          }
          .documents-content
            .documents-content-wrapper
            .product-category
            .file-link {
            display: flex;
            flex-direction: row;
            align-items: center;
            margin-top: 15px;
            margin-bottom: 15px;
          }
          .documents-content
            .documents-content-wrapper
            .product-category
            .file-link
            .file-img {
            margin-right: 7px;
            display: block;
            width: 20px;
            height: auto;
          }
          .documents-content
            .documents-content-wrapper
            .product-category
            .file-link
            .file-title {
            color: var(--accent-grey);
            line-height: 15px;
            font-weight: 300;
          }

          @media (min-width: 768px) {
            .documents-promo
              .documents-promo-container
              .top
              .header-min-colored {
              font-size: 34px;
              line-height: 32px;
              color: white;
              letter-spacing: 0.3px;
              text-shadow: 3px 3px 3px rgba(0, 0, 0, 0.3);
            }
            .documents-promo .documents-promo-container .top .text {
              line-height: 18px;
            }
            .documents-promo .documents-promo-container .bottom {
              margin-top: 45px;
            }
            .documents-promo
              .documents-promo-container
              .bottom
              .promo-link
              .file-promo-link {
              display: flex;
              align-items: center;
            }
            .documents-promo
              .documents-promo-container
              .bottom
              .promo-link
              .file-promo-link
              .file-title {
              line-height: 15px;
            }
            .documents-promo
              .documents-promo-container
              .bottom
              .promo-link
              .file-promo-link
              .file-size {
              line-height: 15px;
              margin-left: 15px;
            }
          }

          @media (min-width: 1200px) {
            .documents-promo {
              padding-top: 50px;
              padding-bottom: 40px;
              border-bottom: 15px solid white;
